import './App.css';
import { Card } from './components/shared/Card/Card';
import { Header } from './components/shared/Header/Header';

function App() {
  const cardList = [
    {
      img:"url('/images/God_of_War_2018_capa.png')",
      desconto: 0.5,
      precoOrig: 200
    }
  ]
  return (
    <section>

      <Header />
      <main>
      {cardList.map((card, index) => (
        <Card
          key={index}
          img={card.img}
          desconto={`${(card.desconto * 100)}%`}
          precoOrig={card.precoOrig}
          price={card.desconto * card.precoOrig}
        />
      ))}
      </main>
    </section>
  );
}

export default App;
